import React from "react";

function Home() {
  return (
    <>
      {/* Header */}
      <header style={{background: '#1977cc', color: 'white', padding: '10px 0'}}>
        <div className="container">
          <h1>MediLab - Dental Clinic</h1>
        </div>
      </header>

      {/* Hero Section */}
      <section style={{background: 'linear-gradient(rgba(25, 119, 204, 0.8), rgba(25, 119, 204, 0.8))', color: 'white', padding: '100px 0', textAlign: 'center'}}>
        <div className="container">
          <h2>WELCOME TO MEDILAB</h2>
          <p>We are team of talented designers making websites with Bootstrap</p>
          <button style={{background: 'white', color: '#1977cc', padding: '10px 20px', border: 'none', borderRadius: '5px'}}>Get Started</button>
        </div>
      </section>

      {/* Main content */}
      <main style={{padding: '50px 0'}}>
        <div className="container">
          <h2>About Us</h2>
          <p>MediLab is a modern medical website template built with Bootstrap 5.</p>
        </div>
      </main>

      {/* Footer */}
      <footer style={{background: '#f8f9fa', padding: '20px 0', textAlign: 'center'}}>
        <p>&copy; 2024 MediLab. All rights reserved.</p>
      </footer>
    </>
  );
}

export default Home;
